export default function seedDistrictFixtures() {
  if(Districts.find().count() === 0) {
    _.each(districts, district => {
      let i = 0;
      const boundaries = _.map(district.geometry.coordinates[0][0], lnglat => {
        const edge = { longitude: lnglat[0], latitude: lnglat[1], ordinal: ++i };

        return edge;
      })

      const properties = district.properties;
      const districtId = Districts.insert({
        name: properties.district,
        area: properties.shape_area,
        perimeter: properties.shape_leng,
        boundaries: boundaries
      });

      console.log("District inserted " + districtId);
    });
  }
}
